s = ""

t = ""

def bormi(s, t):
   
    count = 0
    count2 = 0
    
    for i in range(0, len(s)):
        count = s.count(s[i])
        count2 = t.count(s[i])
        if len(s) == len(t):
            if count != count2:
                return False
        else:
            return False
    return True

print(bormi(s, t))